														execute(prospera, [set(prospera.animation, 'emote_uncross_arms'); sleep_until_animation_finished(); set(prospera.animation, 'emote_emphatic')]),
														[~Let's try this a different way.~],
														set(prospera.animation, 'emote_annoyed'),
