														set(frogatto.animation, 'emote_confused'),
											frogatto,	[~...~],
														set(frogatto.animation, 'emote_raisedfinger'),
														[~I love rewards!~],
														set(prospera.animation, 'emote_talk'),
											prospera,	[~Wonderful.  I'm glad you see things my way.~],				
